24 đội tham dự được chia thành 6 bảng, mỗi bảng có 4 đội. Mỗi đội chỉ được đấu một trận với 3 đội còn lại, tổng cộng là 6 trận. Mỗi trận kéo dài 90 phút, thắng, hòa và thua lần lượt được số điểm là 3, 1 và 0 điểm. Hai đội có số điểm cao nhất mỗi bảng và 4 đội xếp thứ ba có thành tích tốt nhất sẽ đi tiếp vào vòng loại trực tiếp.

Nếu có các đội bằng điểm nhau thì thứ hạng của họ sẽ được xác định theo nguyên tắc sau:

a. Điểm từ các cuộc thi chung;
b. Hiệu số bàn thắng bại giữa các trận đấu;
c) Số bàn thắng ghi được trong các trận đấu;
d. Số bàn thắng sân khách giữa các trận đấu;
e. Nếu vẫn còn các đội chưa được xếp hạng sau khi áp dụng quy tắc a-d thì sẽ được áp dụng quy tắc a-d để so sánh các đội không được xếp hạng. Nếu vẫn không thể phán định thì thứ hạng sẽ được xác định theo quy tắc f-j;
f. Hiệu số bàn thắng bại ở vòng bảng;
g. Số bàn thắng ghi được ở vòng bảng;
h.Số bàn thắng sân khách ở vòng bảng;
i. Tỷ số đấu 1vs1;
j. Xếp hạng của UEFA.
